import React, { useEffect, useState } from 'react'
import getApiProduct from '../../api/getApiProduct'

const ProductMyShop = () => {
    const [products, setProduct] = useState([])
    const getProducts = async () => {
        const rs = await getApiProduct({ limit: 20 })
        if (rs) {
            setProduct(rs?.data)
        }
    }
    useEffect(() => {
        getProducts()
    }, [])
  return (
    <div>ProductMyShop</div>
  )
}

export default ProductMyShop
